    call sc-refresh-status (Subscriber);
end; 
end

g2:c.METHOD.g2:a.TEXT:
opfom-set-alarm-status (DISP:class sc-priority-filter,PRI:integer)
begin
if PRI > the array-length of opfom-priority-alarm-colors and the value of opfom-default-priority-color /= the symbol none then 
   begin
      change the face-color icon-color of DISP to the value of opfom-default-priority-color;
      if not (the sc-active of DISP) then 
        change the checked-color icon-color of DISP to the value of opfom-default-priority-color; 
      end else 
        begin
          if the value of opfom-priority-alarm-colors[PRI - 1] /= the symbol none then  
             begin
               change the face-color icon-color of DISP to the value of opfom-priority-alarm-colors[PRI - 1]; 
                if not (the sc-active of DISP) then 
                change the checked-color icon-color of DISP to the value of opfom-priority-alarm-colors[PRI - 1]; 
            end;
        end;

end

g2:c.PROCEDURE.g2:a.TEXT:
collect-subws-items (WS: class kb-workspace, TGT-list: class item-list)
OBJ: class opfo-domain-object;

begin
  for OBJ = each opfo-domain-object upon WS do
    insert OBJ at the end of TGT-list;
    if the subworkspace SWS of OBJ exists then
      call collect-subws-items (SWS, TGT-list);
  end;
end

g2:c.METHOD.g2:a.TEXT:
GQS-APPLY-FILTER (F: class sc-containment-filter, SRC-list: class item-list, RESULTS-list: class item-list, Client: class object)
M: class smh-transient-message;
CONT-TGT, TGT: class opfo-domain-object;
CONT-LIST: class item-list;

begin
  CONT-TGT = call devu-domain-object-lookup ("[the sc-filter-object of F]");
  if CONT-TGT does not exist then return;
  create an item-list CONT-LIST;
  insert CONT-TGT at the end of CONT-LIST; 
  if the subworkspace SWS of CONT-TGT exists then 
    call collect-subws-items (SWS, CONT-LIST);

  for M = each smh-transient-message in SRC-list do
    TGT = the opfo-domain-object that is the-smh-target-of M;
    if TGT is a member of CONT-LIST then
      insert M at the end of RESULTS-list;
  end;
  delete CONT-LIST;
end

GQS-APPLY-FILTER (F: class sc-class-filter, SRC-list: class item-list, RESULTS-list: class item-list, Client: class object)
M: class smh-transient-message;
TGT: class opfo-domain-object;
CL: symbol;

begin
  CL = symbol (the sc-filter-object of F);
  for M = each smh-transient-message in SRC-list do
    TGT = the opfo-domain-object that is the-smh-target-of M;
    if TGT is an instance of the class named by (CL) then
      insert M at the end of RESULTS-list;
  end;
end

set-filter-data(F: class sc-attribute-filter, Attrib: symbol, NewValue: text)
begin
conclude that the sc-attribute-name of F = Attrib;
conclude that the sc-attribute-value of F = NewValue;
end

sc-set-schematic-object-filter-data-for-browser (BrName: class sc-browser-template, FilterType: symbol, FilterValue: symbol)
BrWs: class _scrollui-dialog-workspace;
TFilter: class sc-schematic-object-filter;
begin
    for BrWs = each _scrollui-dialog-workspace do
        if BrWs is twm-targeted-by BrName then begin
            case (FilterType) of
                TARGET:
                    begin
                        if there exists a sc-target-filter TFilter upon BrWs then call set-filter-data (TFilter, the opfo-domain-object named by FilterValue); 
                    end;
                SENDER:
                    begin
                        if there exists a sc-sender-filter TFilter upon BrWs then call set-filter-data (TFilter, the opfo-domain-object named by FilterValue); 
                    end;
                otherwise:
                    inform the operator that "[FilterType] unknown, use either TARGET or SENDER)";
            end; {case}
        end;
    end;
end

sc-refresh (Filter: class sc-schematic-object-filter ) 
begin
call sc-calculate-filter-data (Filter); 
call next method;
end

sc-refresh (Filter: class sc-filter ) 
ViewManager: class gqsv-tabular-view-manager ;
BrowserQueue: class sc-browser-queue; 
toggle-active: truth-value;
wksp: class kb-workspace;
added, removed: truth-value;
begin
wksp = the workspace of Filter; 
if there exists a ui-client-item Win that is twm-showing-wksp wksp then begin 
    ViewManager, BrowserQueue = call sc-get-manager-and-queue-from-browser-view-ws (wksp, Win);
    call sc-refresh (BrowserQueue, ViewManager, Win); 
end;
end

gqs-apply-filter (SOF: class sc-target-filter, SourceList: class item-list, ResultList: class item-list, Client: class object) 
pass: truth-value;
Item: class smh-transient-message ;
Target: class _opfo-domain-object; 
begin
if there exists a devu-item-list-without-duplicates TargetList that is sc-filtered-object-list-of SOF then begin 
for Item = each smh-transient-message in SourceList do 
    pass = false;
    for Target = each _opfo-domain-object in TargetList do
            if Target is the-smh-target-of Item then begin
                pass = true;
               exit if pass;
            end;
    end;
    if pass then insert Item at the end of ResultList;
end;
end;
end

gqs-apply-filter (SOF: class sc-sender-filter, SourceList: class item-list, ResultList: class item-list, Client: class object) 
pass: truth-value;
Item: class smh-transient-message ;
Sender: class object;
begin
if there exists a devu-item-list-without-duplicates SenderList that is sc-filtered-object-list-of SOF then begin 
for Item = each smh-transient-message in SourceList do 
    pass = false;
    for Sender = each object in SenderList do
            if Sender is the-smh-sender-of Item then begin
                pass = true;
               exit if pass;
            end;
    end;
    if pass then insert Item at the end of ResultList;
end;
end;
end

gqs-apply-filter (AF: class sc-attribute-filter, SourceList: class item-list, ResultList: class item-list, Client: class object) 
pass: truth-value;
Item: class item;
begin
for Item = each item in SourceList do 
    pass = false;
    if the item-or-value IV that is an attribute of Item named by the sc-attribute-name of AF exists and IV is a value and
      the sc-attribute-value of AF exists then begin
        if is-contained-in-text ("*", "[the sc-attribute-value of AF]") or 
            is-contained-in-text ("?", "[the sc-attribute-value of AF]") then
                        pass = call devu-pattern-matcher-with-indices("[IV]", 1, "[the sc-attribute-value of AF]", 1)
        else if IV  = the sc-attribute-value of AF then pass = true;
    end {else pass = true} ;
    if pass then insert Item at the end of ResultList;
end;
end

sc-toggle (Filter: class sc-filter) 
ViewManager: class gqsv-tabular-view-manager ;
BrowserQueue: class sc-browser-queue; 
toggle-active: truth-value;
wksp: class kb-workspace;
additive: truth-value;
begin
wksp = the workspace of Filter; 
toggle-active = call next method;
if there exists a ui-client-item Win that is twm-showing-wksp wksp then begin 
    ViewManager, BrowserQueue = call sc-get-manager-and-queue-from-browser-view-ws (wksp, Win);    
    if toggle-active then begin
        call sc-calculate-filter-data (Filter);  
        {added the above call here and got rid of sc-schematic-object-filter::sc-toggle which was basically calling sc-calculate-filter-data method before a "call next method". Since now there is a sc-filter::sc-calculate-filter-data defined}
        additive = call sc-add-filter (BrowserQueue, Filter);
        if additive then call sc-update-for-additive-or-filter-addition (BrowserQueue, ViewManager, Filter, Win) else call sc-update-for-restrictive-and-filter-addition (BrowserQueue, ViewManager, Filter, Win);  
    end else begin
        additive = call sc-remove-filter (BrowserQueue, Filter );
        if additive then call sc-refresh (BrowserQueue, ViewManager, Win) else call sc-update-for-restrictive-or-filter-removal (BrowserQueue, Filter, Win) ;
    end;
end;
end

sc-calculate-filter-data (F: class sc-schematic-object-filter)
childList: class devu-item-list-without-duplicates;
Obj: class _opfo-domain-object;
begin
 if there exists a devu-item-list-without-duplicates FilterObjList that is sc-filtered-object-list-of F then delete FilterObjList; 
if not (the sc-filter-object of F = "" or the sc-filter-object of F= " ")then begin
   Obj = call devu-domain-object-lookup (the sc-filter-object of F);  
    create a devu-item-list-without-duplicates childList;
    {if Obj is an opfo-containment-object then
        call net-traversal (Obj, find-subworkspace-children, is-an-object, DO-NOTHING-AT-NODE-VISIT, the symbol breadth-first, Obj, childList) 
    else 
        insert Obj at the end of childList;}
    call net-traversal (Obj, find-subworkspace-children, is-an-object, DO-NOTHING-AT-NODE-VISIT, the symbol breadth-first, Obj, childList);
    conclude that F is sc-filtering-on childList;
end;
end

g2:c.PROCEDURE.g2:a.TEXT:
sc-display-status (source: class item, target: class item, wksp: class kb-workspace, window: class ui-client-item)
Subscriber: class sc-smh-status-subscriber ;
PubName:symbol;
Publisher: class item; 

begin

for Subscriber = each sc-smh-status-subscriber upon wksp do
  if not (there exists an item that is the-sc-smh-status-publisher-of Subscriber) then begin
    PubName = the sc-publisher of Subscriber;
    if there exists an smh-message-server NamedServer named by PubName then begin
        if the smh-single-message-list-for-all-telewindows of NamedServer then Publisher = NamedServer 
        else if there exists a smh-message-server Server that is an-smh-view-of NamedServer such that (Server is an-smh-server-of window) then Publisher = Server;
        conclude that Subscriber is an-sc-smh-status-subscriber-of Publisher;
        start sc-refresh-status (Subscriber);   
    end; 
  end;
end;
end

