sc-update-for-restrictive-or-filter-removal (BrowserQueue: class sc-browser-queue , Filter: class sc-filter, Win: class object)

BrowserQueueItems, OrPassList, OrDonotRemoveList, OrRemoveList : class item-list;
Item : class item;

 
begin
        create an item-list BrowserQueueItems;
        call gqs-force-input-buffer-into-queue (BrowserQueue, Win);
        call gqs-get-collected-items(BrowserQueue, BrowserQueueItems, Win);
        create an item-list OrPassList;
        call gqs-apply-filter(Filter, BrowserQueueItems, OrPassList, Win);
        create an item-list OrDonotRemoveList; 
        call gqs-apply-filter(the _sc-browser-filter of BrowserQueue, OrPassList, OrDonotRemoveList, Win);
        create an item-list OrRemoveList; 
        for Item = each item in OrPassList do
            if Item is not a member of OrDonotRemoveList then
                insert item at the end of OrRemoveList;
        end;
        call gqs-remove-items(BrowserQueue, OrRemoveList, Win);
        delete BrowserQueueItems; 
        delete OrPassList;
        delete OrDonotRemoveList;
        delete OrRemoveList 
end

sc-update-for-restrictive-and-filter-addition (BrowserQueue: class sc-browser-queue , ViewManager: class gqsv-tabular-view-manager, Filter: class sc-filter, Win: class object)

BrowserQueueItems, AndPassList, AndRemoveList : class item-list;
Item: class item;
 
begin
        create an item-list BrowserQueueItems; 
        call gqs-force-input-buffer-into-queue (BrowserQueue, Win); 
        call gqs-get-collected-items(BrowserQueue, BrowserQueueItems, Win);
        create an item-list AndPassList;
        call gqs-apply-filter(Filter, BrowserQueueItems, AndPassList, Win);
        create an item-list AndRemoveList;
        for Item = each item in BrowserQueueItems do
            if Item is not a member of AndPassList then
                insert Item at the end of AndRemoveList;
        end;
        call gqs-remove-items (BrowserQueue, AndRemoveList, Win);
        delete BrowserQueueItems; 
        delete AndPassList;
        delete AndRemoveList;
end

sc-update-for-additive-or-filter-addition (BrowserQueue: class sc-browser-queue , ViewManager: class gqsv-tabular-view-manager, Filter: class sc-filter, Win: class object)
Queue: class gqs-queue;
QueueItems, NewItemsList, SendList, SubQueues : class item-list;
sort-key: symbol;
 
 
begin
        create an item-list SubQueues;
        call sc-get-queues-subscribed-by (BrowserQueue, SubQueues, Win);
        create an item-list QueueItems; 
        for Queue = each gqs-queue in SubQueues do
            {allow other processing;}
            call gqs-get-collected-items(Queue, QueueItems, Win);
        end;
            create an item-list NewItemsList;
            call gqs-apply-filter(Filter, QueueItems, NewItemsList, Win); 
            create an item-list SendList;
            call gqs-apply-filter(the _sc-browser-filter of BrowserQueue, NewItemsList, SendList, Win);
            call gqs-send-items({Queue} BrowserQueue , BrowserQueue, SendList, Win); {Bug fix: HQ-1472498}
            delete QueueItems; 
            delete NewItemsList;
            delete SendList;
        call gqs-force-input-buffer-into-queue (BrowserQueue, Win);
        if not (the gqsv-automatically-resort-new-items of ViewManager) then begin
           sort-key = call gqsv-get-current-sort-key(ViewManager, Win); 
            if sort-key is not UNSPECIFIED then
                call gqsv-sort-on-column (ViewManager,sort-key, Win)
            else 
                call gqsv-sort-on-column (ViewManager, the symbol smh-creation-time, Win); 
        end; 
delete SubQueues;
end

g2:c.PROCEDURE.g2:a.TEXT:
sc-delete-browser-queue (BrowserQueue: class sc-browser-queue, Client: class object)
ObjF: class sc-schematic-object-filter;
ViewManager: class gqs-view-manager; 
View, Sheet: item-or-value; 
wksp: class kb-workspace; 
OrKeyFilter: class gqs-or-filter;
begin 
for  ViewManager = each gqs-view-manager that is gqs-view-manager-for-queue BrowserQueue do
                Sheet, View = call gqsv-get-spreadsheet-and-view-from-manager (ViewManager, Client);
                if View is an item then begin 
                    wksp = the workspace of View;                        
                    for ObjF = each sc-schematic-object-filter upon wksp do
                        if there exists a devu-item-list-without-duplicates FilterObjList that is sc-filtered-object-list-of ObjF then delete FilterObjList;
                    end;
                    make wksp transient; 
                    delete wksp; 
                end;
                call gqsv-delete-view (ViewManager, Client);
end; 
For OrKeyFilter = each gqs-or-filter in the gqs-filters of the _sc-browser-filter of BrowserQueue do
      delete OrKeyFilter;
end; 
call gqs-delete-queue (BrowserQueue, Client);    
end

sc-get-queues-subscribed-by (Queue: class gqs-queue, QueueList: class item-list, Client: class object)
Subscriber, Provider, Filter: item-or-value;
SubList: class item-list;
Sub: class gqs-subscription; 
begin
create an item-list SubList;
call gqs-get-subscriptions-from-queue (Queue, SubList, Client);
for Sub = each gqs-subscription in SubList do
    Subscriber, Provider, Filter = call  gqs-get-subscription-details (Sub, Client);
   if Provider is an item then insert Provider at the end of QueueList;
end;
delete SubList; 
end

