sc-refresh (BrowserQueue: class sc-browser-queue , ViewManager: class gqsv-tabular-view-manager, Win: class object)
Queue: class gqs-queue;
QueueItems, SendList, SubQueues : class item-list;
sort-key: symbol;
Dummy: class item = BrowserQueue;
 
begin
    call gqs-clear-input-buffer (BrowserQueue, Win);
    call gqs-clear-queue (BrowserQueue, Win);
    create an item-list SubQueues;
    call sc-get-queues-subscribed-by (BrowserQueue, SubQueues, Win);
    create an item-list QueueItems; 
    for Queue = each gqs-queue in SubQueues do
         {for Queue = each gqs-queue in the _sc-active-subscription-list of BrowserQueue do}
            {allow other processing;}
        call gqs-get-collected-items(Queue, QueueItems, Win);
    end;
    create an item-list SendList;
    call gqs-apply-filter(the _sc-browser-filter of BrowserQueue, QueueItems, SendList, Win);

    {The first agument of this routine is not being used at all.  The original code is below
     and was referencing Queue, which was out of scope and producing and error.}
    call gqs-send-items(Dummy, BrowserQueue, SendList, Win);
            {call gqs-send-items(Queue, BrowserQueue, SendList, Win);}

    delete QueueItems; 
    delete SendList;
    call gqs-force-input-buffer-into-queue (BrowserQueue, Win);
    call gqsv-force-all-scheduled-updates (ViewManager, Win);
    if not (the gqsv-automatically-resort-new-items of ViewManager) then
    begin
        sort-key = call gqsv-get-current-sort-key(ViewManager, Win); 
        if sort-key is not UNSPECIFIED then
            call gqsv-sort-on-column (ViewManager,sort-key, Win)
        else 
            call gqsv-sort-on-column (ViewManager, the symbol smh-creation-time, Win); 
    end; 
    delete SubQueues;
end

