Subscriber: class sc-subscriber;
Win : class ui-client-item;
sort-key: symbol;

begin

Win = the ui-client-item that is twm-showing-wksp BrowserWS;
for Filter = each sc-filter upon BrowserWS do
    if the sc-active of Filter then {call sc-add-filter (BrowserQueue, Filter);}
        {Bug fix: HQ-1476044 replaced the above with the following. 
          defined sc-filter::sc-calculate-filter-data which does nothing}
        begin
        call sc-add-filter (BrowserQueue, Filter); 
        call sc-calculate-filter-data (Filter); 
    end;
end;

for Subscriber = each sc-subscriber upon BrowserWS do
    {allow other processing;}
    if the sc-active of Subscriber then call sc-add-subscriber (BrowserQueue, Subscriber);
end;

call gqs-force-input-buffer-into-queue (BrowserQueue, Win);
        if not (the gqsv-automatically-resort-new-items of ViewManager) then begin
            sort-key = call gqsv-get-current-sort-key(ViewManager, Win); 
            if sort-key is not UNSPECIFIED then
                call gqsv-sort-on-column (ViewManager,sort-key, Win)
            else 
                call gqsv-sort-on-column (ViewManager, the symbol smh-creation-time, Win);
        end; 

end

sc-remove-filter (BrowserQueue: class sc-browser-queue , Filter: class sc-filter) = (truth-value)
filter-key:symbol;
OrKeyFilter: class gqs-or-filter; 
I:integer;
additive:truth-value = false;
{if the filter removal causes more items to be added to the BrowserQueue then additive is true, if items have to be removed from BrowserQueue then additive is false} 
Win:class ui-client-item; 
begin
Win = the ui-client-item that is twm-showing-wksp the workspace of Filter ; 
filter-key = call sc-get-filter-classification-key (Filter);
I = call __gfr-get-position-of-element-in-list (filter-key, the _sc-active-filter-group-key-list of BrowserQueue);
{will return -1 if element is not in list} 
if I >= 0 then begin
    OrKeyFilter = (the gqs-filters of the _sc-browser-filter of BrowserQueue)[I]; 
    if Filter is a member of the gqs-filters of OrKeyFilter then begin
       remove Filter from the gqs-filters of OrKeyFilter;
        if the number of elements in the gqs-filters of OrKeyFilter = 0 then begin
            delete OrKeyFilter;
            remove filter-key from the _sc-active-filter-group-key-list of BrowserQueue;
            additive = true;
        end;
    end;
end;
return additive;
end

sc-add-filter (BrowserQueue: class sc-browser-queue , Filter: class sc-filter) = (truth-value)
filter-key:symbol;
I:integer;
OrKeyFilter: class gqs-or-filter;
additive:truth-value = false;
{if the filter addition causes more items to be added to the BrowserQueue then additive is true, if items have to be removed from BrowserQueue then additive is false}
Win:class ui-client-item;
begin
Win = the ui-client-item that is twm-showing-wksp the workspace of Filter ; 
filter-key = call sc-get-filter-classification-key (Filter);
I = call __gfr-get-position-of-element-in-list (filter-key, the _sc-active-filter-group-key-list of BrowserQueue);
{will return -1 if element is not in list}
if I < 0 then begin
    insert filter-key at the end of the _sc-active-filter-group-key-list of BrowserQueue;
    create a gqs-or-filter OrKeyFilter;
    insert Filter at the end of the gqs-filters of OrKeyFilter;
    insert OrKeyFilter at the end of the gqs-filters of the _sc-browser-filter of BrowserQueue;
end else begin 
    OrKeyFilter = (the gqs-filters of the _sc-browser-filter of BrowserQueue)[I];
    if not (Filter is a member of the gqs-filters of OrKeyFilter) then begin
        insert Filter at the end of the gqs-filters of OrKeyFilter ;
        additive = true;
    end;
end;
return additive;
end

sc-delete (F: class sc-schematic-object-filter)
{Defined this method since the deletion of sc-schematic-object-filter::sc-toggle (and the comment out the code that was deleting FilterObjList in c-schematic-object-filter::sc-toggle) was causing a memory leak of FilterObjList upon deleting a sc-schematic-object-filter from menu-choice.}
begin
if the sc-active of F then begin
    call sc-toggle (F);
    if there exists a devu-item-list-without-duplicates FilterObjList that is sc-filtered-object-list-of F then delete FilterObjList; 
end;
make F transient;
delete F;
end

sc-refresh-status-subscription (Subscriber: class sc-smh-subscriber)
OldPublisher, Publisher: class item;
PubName:symbol;
window: class ui-client-item;
wksp: class kb-workspace; 
begin 
wksp = the workspace of Subscriber; 
if there exists a ui-client-item window that is twm-showing-wksp wksp then begin 
    if there exists an item OldPublisher that is the-sc-smh-status-publisher-of Subscriber then 
        conclude that OldPublisher is not the-sc-smh-status-publisher-of Subscriber; 
    PubName = the sc-publisher of Subscriber;    
    if there exists an smh-message-server NamedServer named by PubName then begin
        if the smh-single-message-list-for-all-telewindows of NamedServer then Publisher = NamedServer 
        else if there exists a smh-message-server Server that is an-smh-view-of NamedServer such that (Server is an-smh-server-of window) then Publisher = Server;
        conclude that Subscriber is an-sc-smh-status-subscriber-of Publisher;
        change the alarm-region icon-color of Subscriber to transparent; 
        change the acknowledgement-region icon-color of Subscriber to transparent; 
        start sc-refresh-status (Subscriber );
    end; 
end; 
end

sc-refresh-status (Subscriber: class sc-smh-subscriber)
color: symbol;
Publisher: class smh-message-server; 
begin
Publisher = the item that is the-sc-smh-status-publisher-of Subscriber;
{color = opfom-priority-alarm-colors [min(the _smh-highest-message-priority of Publisher, the array-length of opfom-priority-alarm-colors) - 1];}
if the  _smh-highest-message-priority of Publisher > the array-length of opfom-priority-alarm-colors then
    color = opfom-default-priority-color else
    color = opfom-priority-alarm-colors [the _smh-highest-message-priority of Publisher - 1]; 
if there exists a smh-message that is smh-owned-by Publisher then 
                begin
                if the _smh-acknowledgement-status of Publisher is acknowledged then 
                    begin
                    change the alarm-region icon-color of subscriber to transparent;
                    change the acknowledgement-region icon-color of subscriber to the value of color
                    end
                else begin
                    change the alarm-region icon-color of subscriber to the value of color;
                    change the acknowledgement-region icon-color of subscriber to transparent;
                end;
            end
            else begin 
               change the alarm-region icon-color of subscriber to transparent;
                    change the acknowledgement-region icon-color of subscriber to transparent
                end; end

