sc-unsubscribe (Subscriber: class sc-smh-subscriber, BrowserQueue: class sc-browser-queue)
Publisher: class gqs-queue;
Win: class ui-client-item;
PubSubscriptions, PubItems {, QueueList, SubQueues} : class item-list;
Subscription: class gqs-subscription; 
{PubItem: class item;
ActivePub: class gqs-queue;}
{I : integer = 0;}

{Note: There are two options of unsuscribing. Iterating over all the items in Publisher or BrowserQueue. The efficiency of these two depend on the filters that are selected and the number of subscriptions. The commented statements iterate over the other option} 

begin

if there exists a gqs-queue Publisher that is the-sc-publisher-of Subscriber then begin
Win = the ui-client-item that is twm-showing-wksp the workspace of Subscriber; 

create an item-list PubSubscriptions;
call gqs-get-subscriptions-from-queue-to-queue (BrowserQueue, Publisher, PubSubscriptions, Win);
for Subscription = each gqs-subscription in PubSubscriptions do
        call gqs-unsubscribe (Publisher, Subscription, BrowserQueue, Win);
        make Subscription transient; 
        delete Subscription; 
end;
delete  PubSubscriptions;
create an item-list PubItems;

call gqs-get-collected-items (Publisher, PubItems, Win);

{Instead of iterating over all items in the Publisher, if the assumption that an item will not be in two queues, which is true for smh-transient-messages and servers, and also not allowing two subscribers to the same server on the browser, which is generally true, the following improves performance atleast twice}

{Has to clear since all the PubItems might not have made it to the BrowserQueue}

call gqs-force-input-buffer-into-queue (BrowserQueue, Win); 

call gqs-remove-items (BrowserQueue, PubItems, Win); 

{call gqs-get-collected-items (BrowserQueue, PubItems, Win);}
{for PubItem = each item in PubItems do
    allow other processing; 
    create an item-list QueueList;
    call gqs-get-queues-containing-item ( PubItem, QueueList, Win);

    if BrowserQueue is a member of QueueList then begin}

   { if Publisher is a member of QueueList then begin}
       { if the number of elements in QueueList > 2 then begin
            I = 0;
            create an item-list SubQueues;
            call sc-get-queues-subscribed-by (BrowserQueue, SubQueues, Win);
            for ActivePub =  each gqs-queue in SubQueues do}
            {for ActivePub =  each gqs-queue in the _sc-active-subscription-list of BrowserQueue do}
             {  if ActivePub is a member of QueueList then I = I + 1;
                exit if I = 1 ;
            end;
            delete SubQueues;
            if I < 1 then call gqs-remove-single-item (BrowserQueue,  PubItem, Win);
        end 
        else call gqs-remove-single-item (BrowserQueue,  PubItem, Win);
    end;
    delete QueueList; 
end;}
    if there exists a gqs-view-manager Manager that is gqs-view-manager-for-queue BrowserQueue then call gqsv-force-all-scheduled-updates (Manager, Win);
delete PubItems;
end;
end

sc-subscribe (Subscriber: class sc-smh-subscriber, BrowserQueue: class sc-browser-queue) = (class item)
PubName: symbol;
Publisher: class item;
Win: class ui-client-item;
GQSub: class gqs-subscription; 
begin
Win = the ui-client-item that is twm-showing-wksp the workspace of Subscriber; 
  PubName = the sc-publisher of Subscriber;
    if there exists an smh-message-server NamedServer named by PubName then begin
        if the smh-single-message-list-for-all-telewindows of NamedServer then Publisher = NamedServer 
        else if there exists a smh-message-server Server that is an-smh-view-of NamedServer such that (Server is an-smh-server-of Win) then Publisher = Server;
        create a gqs-subscription GQSub; 
        conclude that the gqs-send-already-collected-items of GQSub = true; 
        call gqs-attach-filter-to-subscription (GQSub, the _sc-browser-filter of BrowserQueue, Win); 
        call gqs-subscribe (GQSub, Publisher, BrowserQueue, Win); 
        return Publisher; 
    end;
end

sc-toggle (ToggleButton: class sc-toggle-button ) = (truth-value)
begin
if the sc-active of ToggleButton then begin
    conclude that the sc-active of ToggleButton is false;
    change the checked-color icon-color of ToggleButton to the face-color icon-color of ToggleButton;
end 
else begin 
    conclude that the sc-active of ToggleButton is true;
    change the color-pattern of ToggleButton so that checked-color is black; 
end;
return the sc-active of ToggleButton;
end

sc-toggle (Subscriber: class sc-subscriber) 
ViewManager: class gqsv-tabular-view-manager;
BrowserQueue: class sc-browser-queue; 
toggle-active: truth-value;
wksp: class kb-workspace;
sort-key: symbol;
begin
wksp = the workspace of Subscriber; 
toggle-active = call next method;
if there exists a ui-client-item Win that is twm-showing-wksp wksp then begin 
    ViewManager, BrowserQueue = call sc-get-manager-and-queue-from-browser-view-ws (wksp, Win);
    if toggle-active then begin
        call sc-add-subscriber (BrowserQueue, Subscriber);
        call gqs-force-input-buffer-into-queue (BrowserQueue, Win);
        if not (the gqsv-automatically-resort-new-items of ViewManager) then begin
           sort-key = call gqsv-get-current-sort-key(ViewManager, Win); 
            if sort-key is not UNSPECIFIED then
                call gqsv-sort-on-column (ViewManager,sort-key, Win)
            else 
                call gqsv-sort-on-column (ViewManager, the symbol smh-creation-time, Win); 
        end;
    end else
        call sc-remove-subscriber (BrowserQueue, Subscriber);
 
end;
end

g2:c.PROCEDURE.g2:a.TEXT:
sc-update-browsers ()
ColumnHeader: class gqsv-column-header-specification;
begin
    for ColumnHeader = each gqsv-column-header-specification do
        if the gxl-cell-type of ColumnHeader = the symbol text-cell and the gqsv-key-value-conversion-procedure of ColumnHeader = the symbol opcs-get-msg-text then
        begin
            if the gqsv-monitor-this-attribute of ColumnHeader then
                conclude that the gqsv-monitor-this-attribute of ColumnHeader = false;
        end;
    end;
end

